import React from "react";
import Layout from "../../components/shared/Layout/Layout";
const Donar = () => {
  const [data, setData] = useState([]);
  //find donar records
  const getDonars = async () => {
    try {
      const { data } = await API.get("/inventory/get-donars");
      //   console.log(data);
      if (data?.success) {
        setData(data?.donars);
      }
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    getDonars();
  }, []);

  return (
    <Layout>
      <h1>Donar Page </h1>
    </Layout>
  );
};

export default Donar;
